    "2013-03-14T19:25:14.161996",nt"name": "san-francisco-littoral-cell-crsmp-coastal-armoring-lines-2011",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset is an updated version of the
    shapefile created by Jennifer Dare at the California Coastal Commission in 2005.
    The version created by Elena Vandebroek (ESA PWA) in 2011 changed the original version
    in the following ways: - Study area was focused to San Francisco County and part
    of San Mateo County. - Armoring was moved/added to a more accurate location in space,
    using NAIP aerial imagery from 2010. The original armor data set projected all armoring
    along a single shoreline. - The new armor dataset reflects removals, additions,
    or changes to the armoring in the study area since the 2005 armor dataset by Jennifer
    Dare.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
